import React from 'react';


class Landing extends React.Component {
    constructor(props) {
        super(props);
    }
    render(){
        const buttonList = [
            "Characters", "Rules", "Inventory", "Map", "Stats", "Reference", "Settings"
        ];
        const apps = buttonList.map((student) =>
            <div className={"student square "+ student} id={student+"Square"}>
                <button id={student+"Button"} onClick={() => this.loadCard(student)}>
                    <StudentMug character={student}/>
                </button>
            </div>
        );
        return(
            <div className="landingOverlay">
                <div className="landingMenu">
                    <div className="landingGrid">

                    </div>
                </div>
                <div className="loadingAnimation">

                </div>
            </div>
        );
    }
} export default Landing;
